const items = $input.all();
const result = items
  .map((item) => item.json)
  .map(({ data: { items } }) => items.map(({ id, name }) => `${id} ${name}`))
  .join(", ");
return { result };

// Get all input items
const inputItems = $input.all();

// Process each item
const outputItems = inputItems.map(item => {
    const data = item.json;

    // Extract metrics from input data
    const lik = data.video.diggCount || 0;
    const shars = data.video.shareCount || 0;
    const views = data.video.playCount || 0;
    const collect = data.video.collectCount || 0;
    const coms = data.video.commentCount || 0;
    const subs = data.author.authorMeta.fans || 0;
    const hearts = data.author.authorMeta.heart || 0;
    const vids = data.author.authorMeta.video || 0;

    // Calculate all metrics
    const engageScore = (lik * 0.6) + (coms * 0.9) + (shars * 1.7) + (collect * 0.9);
    const shareRate = Math.log(shars + 1) / Math.log(views + 1);
    const creatorSizeFactor = Math.log(subs + 1) * Math.sqrt(vids + 1);
    const authorEngagementRatio = (hearts / vids) / (subs + 1);
    const estimatedAgeFactor = Math.log(views / (subs * authorEngagementRatio) + 1);
    const rawVirality = (engageScore * shareRate * Math.log(views + 1)) / creatorSizeFactor;
    const timeAdjustedVirality = (engageScore * shareRate * Math.log(views + 1)) / (creatorSizeFactor / estimatedAgeFactor);
    const hashtagPerformance = (engageScore / Math.log(views + 1)) * (shars / (lik + coms + 1)) * Math.log(collect + 1);
    const authorAveragePerformance = hearts / vids;
    const videoPerformance = (lik + coms * 0.8 + shars * 1.5 + collect * 0.7);
    const authorRelativeSuccess = videoPerformance / (authorAveragePerformance / 1000);

    // Fixed replicabilityScore formula to prevent zero values
    const replicabilityScore = (engageScore * shareRate * Math.log(collect + 1) * 1000) / 
                              (Math.log(subs + 1) * Math.sqrt(vids + 1));

    // Return the output in the specified format
    return {
        video: {
            caption: data.video.caption,
            webVideoUrl: data.video.webVideoUrl
        },
        metrics: {
            engageScore: engageScore,
            shareRate: shareRate,
            creatorSizeFactor: creatorSizeFactor,
            authorEngagementRatio: authorEngagementRatio,
            estimatedAgeFactor: estimatedAgeFactor,
            rawVirality: rawVirality,
            timeAdjustedVirality: timeAdjustedVirality,
            hashtagPerformance: hashtagPerformance,
            authorAveragePerformance: authorAveragePerformance,
            videoPerformance: videoPerformance,
            authorRelativeSuccess: authorRelativeSuccess,
            replicabilityScore: replicabilityScore
        }
    };
});

// Return the processed items
return outputItems;

